import { db } from '../api/db';

const seedData = async () => {
  const users = await db.users.toArray();
  const pages = await db.pages.toArray();

  if (!users.length) {
    seedUsers();
  }

  if (!pages.length) {
    seedPages();
  }
};

export default seedData;

